import React, { useState } from 'react';
import "./checkbox.css"
import PropTypes from 'prop-types';


const Checkbox = ({ onClick, name }) => {
  const [nameC, setNameC] = useState('cyberpunk-checkbox')
  return (
  <label class="cyberpunk-checkbox-label">
  <input class={ nameC } type="checkbox" onClick={ () => {
    onClick();
    nameC === "cyberpunk-checkbox" ? setNameC("cyberpunk-checkbox check") : setNameC("cyberpunk-checkbox");
  } }/>
  { name }</label>
  )
};

Checkbox.propTypes = {};

Checkbox.defaultProps = {};

export default Checkbox;
